#if UNITY_EDITOR
using Sirenix.Utilities.Editor;

namespace EDIVE.OdinExtensions
{
    public static class CustomEditorIcons
    {
        private static EditorIcon CreateDisposableLazyEditorIcon(int width, int height, string base64ImageDataPngOrJPG)
        {
            var icon = new LazyEditorIcon(width, height, base64ImageDataPngOrJPG);
            CleanupUtility.DisposeObjectOnAssemblyReload(icon);
            return icon;
        }
        
        private static EditorIcon _android;
        public static EditorIcon Android => _android ??= CreateDisposableLazyEditorIcon(34, 34,
            "");

        private static EditorIcon _ios;
        public static EditorIcon IOS => _ios ??= CreateDisposableLazyEditorIcon(34, 34,
            "");

        private static EditorIcon _windows;
        public static EditorIcon Windows => _windows ??= CreateDisposableLazyEditorIcon(34, 34,
            "");
        
        private static EditorIcon _gameObject;
        public static EditorIcon GameObject => _gameObject ??= CreateDisposableLazyEditorIcon(34, 34,
            "");
        
        private static EditorIcon _firebase;
        public static EditorIcon Firebase => _firebase ??= CreateDisposableLazyEditorIcon(34, 34,
            "");

         private static EditorIcon _discord;
        public static EditorIcon Discord => _discord ??= CreateDisposableLazyEditorIcon(34, 34,
            "");
        
    }
}
#endif
